import { DefaultButton } from "../Buttons/defaultButton"
import { HardDataReset } from "../Functions/DataFunctions/ClearData"
import { GetCurrentChoice } from "../Functions/DataFunctions/Datadealer"
import { bgColor1f, bgColor2e, bgColor4e, bgColor5e } from "../Styles/backGroundColor"

export function SettingsModal({open, onClose}){
    // check if open
    if (!open) return

    return (
    <div style={{width:"100%", height:100, backgroundColor:bgColor2e, borderRadius:20}}>
        <button onClick={HardDataReset} style={{color:"red"}}>Daten von '{GetCurrentChoice()}' l√∂schen</button>

        <DefaultButton name="close" fontSize="20px" color="red" click={onClose}/>
    </div>)
}
